import { Divider } from "@material-ui/core";
import React from "react";
import axios from 'axios';



export function ListApplications({
    props
}) {

    const [apps, setApps] = React.useState('Test')

    const getApps = () => {

    axios.get('http://localhost:5001/api/applist').then(data => {
        setApps(<i>{data.user}</i>)
    })

    }

    return (
        <div>
            <p onClick={getApps}>{apps}</p>
        </div>
    )
}
